        </div>

        <div className="card">
          <h2>üì¶ View Orders</h2>
          <p>Check order history and manage deliveries.</p>
        </div>

        <div className="card">
          <h2>üë• User Management</h2>
          <p>View or block user accounts and assign roles.</p>
        </div>
      </div>
    </div>
  );
};

